// /src/pages/HomePage/WhyChooseUs.js
import React from "react";
import FeatureCard from "../../components/HomePage/FeatureCard";
import "../../styles/HomePage/WhyChooseUs.css";

const WhyChooseUs = () => {
  const features = [
    { icon: "verified.png", title: "Verified Doctors", desc: "We list only licensed professionals" },
    { icon: "affordable.png", title: "Affordable Care", desc: "Lowest consultation fees" },
    { icon: "support.png", title: "24/7 Support", desc: "Our team is always here to help" },
  ];

  return (
    <section className="why-us">
      <h2>Why Choose AyuRaksha?</h2>
      <div className="features">
        {features.map((item, index) => (
          <FeatureCard key={index} icon={item.icon} title={item.title} desc={item.desc} />
        ))}
      </div>
    </section>
  );
};

export default WhyChooseUs;
